import React from "react";
import app from "../base";
import { DashboardLayout } from "../components/Layout";

const Home = () => {
  return (
   
   <DashboardLayout>
      <h2>Home Page</h2>
      <button onClick={() => app.auth().signOut()}>Sign out</button>
    </DashboardLayout>
  
   
  );  
};
 
export default Home;
